import React from "react";
import "./paging.css";

function paging({ charactersPerPage, allCharacter, Paginited }) {
  const pageNumber = [];

  for (let i = 1;i <= Math.ceil(allCharacter.length / charactersPerPage);i++ ) {
    pageNumber.push(i);
  }
  return (
    <nav>
      <ul className="pagination">
        {pageNumber &&
          pageNumber.map((number) => (
            <li key={number} className="page-item">
              <a onClick={() => Paginited(number)}>{number}</a>
            </li>
          ))}
      </ul>
    </nav>
  );
}
